import React, { useState } from 'react';
import { useLocation } from 'react-router-dom';

import './Auth.css';

const RestaurantsHome = () => {
    const location = useLocation();
    const [active, setActive] = useState('delivery');

    return (
        <div className='container-fluid my-5 px-md-5'>
            <div className='row mt-5 pt-5 mx-md-2'>
                <div className='col-lg-10 col-10 offset-lg-1 offset-1 p-md-4 p-3 shadow'>
                    <div class='row my-3'>
                        <div className='col-lg-3 col-md-5 col-8 p-0'>
                            <div className='border border-dark rounded-pill d-flex flex-row'>
                                <button id='delivery' className={`btn btn-raised rounded-pill w-100 searchOption fs-6 ${active === 'delivery' && 'btn-switch-filled'}`} onClick={(e) => { setActive(e.target.id) }}>
                                    Delivery
                                </button>
                                <button id='pickUp' className={`btn btn-raised rounded-pill w-100 searchOption fs-6 ${active === 'pickUp' && 'btn-switch-filled'}`} onClick={(e) => { setActive(e.target.id) }}>
                                    Pick Up
                                </button>
                            </div>
                        </div>
                    </div>
                    <h3 className='text-start'>{`Food Delivery in ${location.pathname.split('/')[2]}`}</h3>
                    <p className='text-p'>Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry's standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.</p>
                    <div className='col-12 border-top border-3 text-center my-3 pt-3'>
                        <h3 className='text-start'>Explore by category</h3>
                    </div>
                </div>
            </div>
        </div>
    )
}

export default RestaurantsHome;
